import React from "react";
import HeadTag from "./HeadTag";
import Button from '@mui/material/Button';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import Footers from "./footer";
import TypeCard from "./typesCard";

function RenderTypes(props) {

    const fullDiv = {
        "margin": "10%",
        "padding": "2%",
        height: "100%"
    };

    const anchorStyle = {
        "textDecoration": "none"
    };


    const boxStyle = {
        "height": "10%"
    };

    const data = props.items;
    console.log(data);

    return (

        <div>

            <HeadTag Title="Python" />

            <div className="container-fluid">

                <div style={fullDiv} className="row" >

                        {/* <div className="col-lg-4 col-md-6 col-sm-6 box" style={boxStyle}>
                            <TypeCard title="Turtle" type="turtle" />
                        </div> */}


                        <div className="col-lg-4 col-md-6 col-sm-6 box" style={boxStyle}>
                            <TypeCard title="Data Science" type="ds" />
                        </div>


                        <div className="col-lg-4 col-md-6 col-sm-6 box" style={boxStyle}>
                            <TypeCard title="Web Development"  type="web" />
                        </div>


                        <div className="col-lg-4 col-md-6 col-sm-6 box" style={boxStyle}>
                            <TypeCard title="selenium"  type="selenium" />
                        </div>

                    <Button> <a style={anchorStyle} href="/themes"> <ArrowBackIcon /> All Themes </a> </Button>

                </div>
            </div>
            <Footers></Footers>
        </div>
    );


}

export default RenderTypes;
